import React, { Component } from "react";
import UserService from "../services/UserService";

class ListUserComponent extends Component {
  constructor(props) {
    super(props);

    this.state = {
      users: [],
      search: "",
    };
    this.addUser = this.addUser.bind(this);
    this.editUser = this.editUser.bind(this);
    this.deleteUser = this.deleteUser.bind(this);
  }

  deleteUser(id) {
    UserService.deleteUser(id).then((res) => {
      this.setState({
        users: this.state.users.filter((user) => user.id !== id),
      });
    });
  }
  viewUser(id) {
    this.props.history.push(`/view-user/${id}`);
  }
  editUser(id) {
    this.props.history.push(`/add-user/${id}`);
  }

  handleSearch(event) {
    this.setState({ search: event.target.value });
  }

  componentDidMount() {
    UserService.getUsers().then((res) => {
      if (res.data == null) {
        this.props.history.push("/add-user/_add");
      }
      this.setState({ users: res.data });
    });
  }

  addUser() {
    this.props.history.push("/add-user/_add");
  }

  render() {
    const { users, search } = this.state;

    const filteredUsers = users.filter((user) => {
      return (
        user.date.toLowerCase().includes(search.toLowerCase()) ||
        user.description.toLowerCase().includes(search.toLowerCase()) ||
        user.amount.toLowerCase().includes(search.toLowerCase()) ||
        user.status.toLowerCase().includes(search.toLowerCase()) ||
        user.receiver.toLowerCase().includes(search.toLowerCase()) ||
        user.jk.toLowerCase().includes(search.toLowerCase()) ||
        user.no_telp.toLowerCase().includes(search.toLowerCase()) ||
        user.address.toLowerCase().includes(search.toLowerCase())
      );
    });

    return (
      <div>
        <h2 className="text-center">List Transaksi</h2>

        <br></br>
        <div style={{ fontSize: "13px" }}>
          <div className="row">
            <div className="col-md-12 mb-3">
              <input
                type="text"
                placeholder="Search"
                className="form-control"
                value={search}
                onChange={this.handleSearch}
              />
            </div>
          </div>

          <div className="row">
            <table className="table table-striped table-bordered">
              <thead>
                <tr>
                  <th style={{ width: "1%", textAlign: "center" }}>ID</th>
                  <th style={{ width: "30%", textAlign: "center" }}>Tanggal</th>
                  <th style={{ width: "30%", textAlign: "center" }}>
                    Deskripsi
                  </th>
                  <th style={{ width: "1%", textAlign: "center" }}>
                    Nominal Transaksi
                  </th>
                  <th style={{ width: "1%", textAlign: "center" }}>Status</th>
                  <th style={{ width: "1%", textAlign: "center" }}>
                    Penangung Jawab
                  </th>
                  <th style={{ width: "1%", textAlign: "center" }}>
                    Jenis Kelamin
                  </th>
                  <th style={{ width: "1%", textAlign: "center" }}>
                    No Telpon
                  </th>
                  <th style={{ width: "30%", textAlign: "center" }}>Alamat</th>
                  <th style={{ textAlign: "center" }}>Action</th>
                </tr>
              </thead>
              <tbody>
                {this.state.users.map((user) => (
                  <tr key={user.id}>
                    <td>{user.id}</td>
                    <td>{user.date}</td>
                    <td>{user.description}</td>
                    <td>{user.amount}</td>
                    <td>{user.status}</td>
                    <td>{user.receiver}</td>
                    <td>{user.jk}</td>
                    <td>{user.no_telp}</td>
                    <td>{user.address}</td>
                    <td>
                      <div className="d-flex justify-content-between">
                        <button
                          onClick={() => this.editUser(user.id)}
                          className="btn btn-info"
                        >
                          Update
                        </button>
                        <button
                          style={{ marginLeft: "10px" }}
                          onClick={() => this.deleteUser(user.id)}
                          className="btn btn-danger"
                        >
                          Delete
                        </button>
                        <button
                          style={{ marginLeft: "10px" }}
                          onClick={() => this.viewUser(user.id)}
                          className="btn btn-info"
                        >
                          View
                        </button>
                      </div>
                    </td>
                  </tr>
                ))}
              </tbody>
            </table>
          </div>
          <div className="row">
            <div className="col-md-7 d-flex justify-content-end">
              <button className="btn btn-primary" onClick={this.addUser}>
                Add Transaksi
              </button>
            </div>
          </div>
        </div>
      </div>
    );
  }
}

export default ListUserComponent;
